import React, { useState } from "react";

const Body = (props) => {
  let name = props.myObj.name;
  let age = props.myObj.age;

  const ageIncreaseHandler = () => {
    age += 10;
    console.log(name + " is " + age);
    this.setState(age);
  };

  return (
    <div>
      <h1>Body</h1>
      <p>This is a new component!</p>
      <button onClick={ageIncreaseHandler}>
        Click to make {props.myObj.name} older!
      </button>
      <p>
        I am {props.myObj.name}. I am {props.myObj.age} years old.{" "}
      </p>
    </div>
  );
};

export default Body;
